import React from "react";
import { Link } from "react-router-dom";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import logo from './logo.png';
import Card from "@material-ui/core/Card";

const Themes = props => {
  return (
    <div className="Themes">
  <header className="App-header">
    <h1 className="App-title">Themes</h1>
    <p>
    </p>

    <Link to="/create" className="home-link">
        <Card className="home box1">
          <Typography variant="title">GROWING UP</Typography>
        </Card>
      </Link>


      <Link to="/individual" style={{ textDecoration: 'none' }}>

  <Button
  style={{ margin: "10px" }}
  size= "large"
  variant="contained"
  color= "primary"
  onClick={() =>
    console.log("click")
  }
>
HIV & AIDS
</Button>
    </Link>


     <Link to="/individual" style={{ textDecoration: 'none' }}>

      <Button
      style={{ margin: "10px" }}
      size= "large"
      variant="contained"
      color= "primary"
      onClick={() =>
        console.log("click")
      }
    >
    Relationships
    </Button>
        </Link>


    <a
      className="App-link"
      target="_blank"
      rel="noopener noreferrer"
    >
    </a>
  </header>
</div>
);
};
export default Themes;
